/* Procedure structure for procedure `master_bagian` */

DELIMITER $$

/*!50003 CREATE PROCEDURE `master_bagian`(OUT nomor INT(10))
BEGIN     
    DECLARE jml INT DEFAULT 0;    
        

    DECLARE cur_query CURSOR FOR select mbagian from conter;         
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET jml = 1;
         
    OPEN cur_query; 
    WHILE (NOT jml) DO
          FETCH cur_query INTO nomor; 
          IF NOT jml THEN                
             update conter set mbagian=mbagian+1;            
          END IF;         
    END WHILE; 

    CLOSE cur_query;

END */$$
DELIMITER ;

